import React from 'react';
import { Card , CardImg, CardText, CardBody, CardTitle, CardSubtitle, Button } from 'reactstrap';
import './Card.scss';

const WorkCard = () => {
  return (
    <div className="flex-card" >
      <img className="flex-card__img" src="https://images.unsplash.com/photo-1506994011460-5482746d30a1?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=634&q=80" alt=""/>
      <div className="flex-card__body">
        <h3 className="flex-card__title">Web App</h3>
        <p className="flex-card__text">A music store</p>  
      </div>
    </div>
  )
}

export default WorkCard
